    private void Safe(string filename, string fullPath)
    {
        string trimFilename = filename.Remove(filename.Length - 4);
        string[] formatedFilename = trimFilename.Split(new char[] {'_'});
        string timeReplace = formatedFilename[1].Replace("-", ":");
        
        string strDatetime = formatedFilename[0] + " " + timeReplace;
        
        DateTime.TryParse(strDatetime, out DateTime dateTime);
        
        var file = new File()
        {
            DateTime = dateTime,
            FromPhone = formatedFilename[3],
            ToNumber = formatedFilename[5],
            SessionNumber = formatedFilename[7],
            Name = filename,
            FullPath = fullPath,
        };

        _context.Files?.Add(file);
        _context.SaveChanges();
    }
    
